package com.demo.dowhileloop;
//Write a Program To print sum of 1 to 50 Odd nos
public class Prog5 {
//Write a Program To print sum of 1 to 50 Odd nos.
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=1;
		do {
			if(i%2==1) {
				System.out.println(i);
			}
			i++;
			
		
		}
		while(i<=50);

	}

}
